<!DOCTYPE html>
<html lang="zh-CN">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>号码查询系统</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Segoe UI', 'Microsoft YaHei', sans-serif;
        }
        
        body {
            background: linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%);
            min-height: 100vh;
            padding: 20px;
            display: flex;
            flex-direction: column;
            align-items: center;
        }
        
        .container {
            width: 100%;
            max-width: 800px;
            background-color: white;
            border-radius: 12px;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.1);
            overflow: hidden;
            margin-top: 20px;
        }
        
        header {
            background: linear-gradient(90deg, #3498db, #2c3e50);
            color: white;
            padding: 25px 20px;
            text-align: center;
        }
        
        h1 {
            font-size: 28px;
            margin-bottom: 10px;
        }
        
        .description {
            font-size: 16px;
            opacity: 0.9;
        }
        
        .search-section {
            padding: 25px;
            background-color: #f8f9fa;
            border-bottom: 1px solid #eaeaea;
        }
        
        .search-box {
            display: flex;
            gap: 10px;
            margin-bottom: 15px;
        }
        
        input[type="text"] {
            flex: 1;
            padding: 12px 15px;
            border: 2px solid #3498db;
            border-radius: 6px;
            font-size: 16px;
            outline: none;
            transition: all 0.3s;
        }
        
        input[type="text"]:focus {
            box-shadow: 0 0 0 3px rgba(52, 152, 219, 0.3);
        }
        
        button {
            background-color: #3498db;
            color: white;
            border: none;
            border-radius: 6px;
            padding: 12px 20px;
            font-size: 16px;
            cursor: pointer;
            transition: background-color 0.3s;
        }
        
        button:hover {
            background-color: #2980b9;
        }
        
        .result-section {
            padding: 20px;
            min-height: 100px;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
        }
        
        .result-box {
            width: 100%;
            padding: 20px;
            border-radius: 8px;
            text-align: center;
            font-size: 18px;
            font-weight: bold;
            border: 2px solid #e74c3c;
            transition: all 0.3s;
        }
        
        .target {
            background-color: rgba(46, 204, 113, 0.1);
            color: #27ae60;
        }
        
        .non-target {
            background-color: rgba(231, 76, 60, 0.1);
            color: #c0392b;
        }
        
        .history-section {
            padding: 20px;
            border-top: 1px solid #eaeaea;
        }
        
        .history-title {
            font-size: 18px;
            margin-bottom: 15px;
            color: #2c3e50;
            display: flex;
            justify-content: space-between;
            align-items: center;
        }
        
        .clear-history {
            background-color: #e74c3c;
            padding: 5px 10px;
            font-size: 14px;
        }
        
        .clear-history:hover {
            background-color: #c0392b;
        }
        
        .history-list {
            max-height: 200px;
            overflow-y: auto;
            border: 1px solid #eaeaea;
            border-radius: 6px;
            padding: 10px;
        }
        
        .history-item {
            padding: 8px 10px;
            border-bottom: 1px solid #f1f1f1;
            display: flex;
            justify-content: space-between;
        }
        
        .history-item:last-child {
            border-bottom: none;
        }
        
        .history-number {
            font-weight: bold;
        }
        
        .history-result {
            font-weight: bold;
        }
        
        .history-target {
            color: #27ae60;
        }
        
        .history-non-target {
            color: #c0392c;
        }
        
        footer {
            margin-top: 20px;
            text-align: center;
            color: #7f8c8d;
            font-size: 14px;
            padding: 10px;
        }
        
        @media (max-width: 600px) {
            .search-box {
                flex-direction: column;
            }
            
            button {
                width: 100%;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <header>
            <h1>号码查询系统</h1>
            <p class="description">输入号码查询是否在目标号码列表中</p>
        </header>
        
        <section class="search-section">
            <div class="search-box">
                <input type="text" id="phoneInput" placeholder="请输入要查询的号码">
                <button id="searchBtn">查询</button>
            </div>
            <p style="font-size: 14px; color: #7f8c8d;">提示：请输入完整的11位手机号码</p>
        </section>
        
        <section class="result-section">
            <div id="resultBox" class="result-box" style="display: none;">
                <!-- 查询结果将在这里显示 -->
            </div>
        </section>
        
        <section class="history-section">
            <div class="history-title">
                <span>查询记录</span>
                <button class="clear-history" id="clearHistoryBtn">清空记录</button>
            </div>
            <div class="history-list" id="historyList">
                <!-- 查询历史将在这里显示 -->
            </div>
        </section>
    </div>
    
    <footer>
        <p>号码查询系统 &copy; 2023</p>
    </footer>

            }
            
            // 检查号码是否在目标列表中
            const isTarget = phoneNumbers.includes(phoneNumber);

            showResult(phoneNumber, isTarget);
            
            // 添加到查询历史
            addToHistory(phoneNumber, isTarget);

            phoneInput.value = '';

            resultBox.textContent = `${phoneNumber} ${isTarget ? '是目标号码' : '非目标号码'}`;

            resultBox.style.display = 'block';
        }
        
        // 添加到查询历史
        function addToHistory(phoneNumber, isTarget) {
            // 检查是否已存在相同查询
            const existingIndex = queryHistory.findIndex(item => item.phone === phoneNumber);
            
            if (existingIndex !== -1) {
                // 如果已存在，移动到最前面
                queryHistory.splice(existingIndex, 1);
            }
            
            // 添加到历史记录开头
            queryHistory.unshift({
                phone: phoneNumber,
                isTarget: isTarget,
                timestamp: new Date().toLocaleString()
            });
            
            // 限制历史记录数量（最多50条）
            if (queryHistory.length > 50) {
                queryHistory = queryHistory.slice(0, 50);
            }
            
            // 保存到本地存储
            localStorage.setItem('phoneQueryHistory', JSON.stringify(queryHistory));
            
            // 更新显示
            renderHistory();
        }
        
        // 渲染查询历史
        function renderHistory() {
            if (queryHistory.length === 0) {

                    <span class="history-result ${item.isTarget ? 'history-target' : 'history-non-target'}">

                    </span>
                    <span style="color: #95a5a6; font-size: 12px;">${item.timestamp}</span>
